// Get the input data
const inputData = items[0]; // Access the main JSON object

// Extract currentTime and updatedTime arrays
const currentTimeData = inputData.json.currentTime[0].workflows; // Access workflows array
const updatedTimeData = inputData.json.updatedTime; // Access the updated workflow data

// Create a mapping of workflow IDs to their complete workflow objects
const updatedTimeMap = {};
const newWorkflows = [];

// Process updated workflows and identify new ones
updatedTimeData.forEach(entry => {
    const workflow = entry.json.workflow;
    updatedTimeMap[workflow.id] = workflow.lastUpdated;

    // Check if this workflow exists in currentTimeData
    const existingWorkflow = currentTimeData.find(w => w.id === workflow.id);
    if (!existingWorkflow) {
        // This is a new workflow - add it to our list of new workflows
        console.log(`Adding new workflow: ${workflow.name} (${workflow.id})`);
        newWorkflows.push({
            id: workflow.id,
            lastUpdated: workflow.lastUpdated,
            name: workflow.name
        });
    }
});

// Update the currentTime's lastUpdated field based on the updatedTime data
currentTimeData.forEach(row => {
    if (updatedTimeMap[row.id]) {
        row.lastUpdated = updatedTimeMap[row.id]; // Update the lastUpdated value
    }
});

// Add the new workflows to currentTimeData
const updatedWorkflows = [...currentTimeData]; // Create a copy
if (newWorkflows.length > 0) {
    updatedWorkflows.push(...newWorkflows);
}

// Return the updated structure, keeping the renamed fields
return [
    {
        json: {
            updatedData: updatedWorkflows, // Use our local copy with new items added
            timesReplaced: updatedTimeData 
        }
    }
];
